--可疑上报信息表
DROP TABLE AML_BS_UPLOAD;
create table AML_BS_UPLOAD
(
  rec_id         VARCHAR2(32) not null,
  report_id      NUMBER(11),
  brno           VARCHAR2(20),          --分行号
  work_date      VARCHAR2(8),            --工作日期
  report_type    VARCHAR2(1),           --报文类型
  finm           VARCHAR2(64),           --金融机构名称
  firc           VARCHAR2(6),           --金融机构所在地区编码
  fict           VARCHAR2(2),           --金融机构代码类型
  ficd           VARCHAR2(12),           --金融机构代码
  stcr           VARCHAR2(32),           --可疑特征（多选）
  ssdg           VARCHAR2(2),            --可疑程度
  tkms           VARCHAR2(128),          --采取措施
  ssds           VARCHAR2(500),          --可疑行为描述
  xmlnm          VARCHAR2(128),          --xml文件名
  zipnm          VARCHAR2(128),          --zip包名
  rec_status     VARCHAR2(2),            --记录状态
  rep_status     VARCHAR2(2),            --回执状态
  approve_status VARCHAR2(2),            --审核状态
  is_sub_success VARCHAR2(1),            --是否成功上报
  approve_result      VARCHAR2(256),    --审核说明
  approve_upd_tlr     VARCHAR2(20),    --最后审核用户
  approve_upd_tm      DATE,            --最后审核时间
  lst_upd_tlr         VARCHAR2(20),    --最后操作用户
  lst_upd_tm          DATE,            --最后操作时间
  IS_COMP       VARCHAR2(1),          --完整性标识
  ERRMSG       VARCHAR2(500),
  filler1        VARCHAR2(64),
  filler2        VARCHAR2(64),
  filler3        VARCHAR2(64),
  filler4        VARCHAR2(64),
  filler5        VARCHAR2(64),
  filler6        VARCHAR2(64),
  PRIMARY KEY (REC_ID)
);
